commits.content:
import React, { Fragment } from 'react';
import { Button, Icon } from 'rsuite';

const DashboardToggle = () => {
  return (
    <Fragment>
      <Button block color="blue">
        <Icon icon="dashboard" />
      </Button>
    </Fragment>
  );
};

export default DashboardToggle;
